package bd.edu.seu.messmanagmentsystem.model;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import javax.persistence.*;import java.time.LocalDate;@Data@AllArgsConstructor@NoArgsConstructor@Entitypublic class UserDeposit {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private long depositNo;    private double depositAmount;    private LocalDate date;    @OneToOne    private Member member;}